import { createSlice, PayloadAction } from '@reduxjs/toolkit';
import AsyncStorage from '@react-native-async-storage/async-storage';
import { AppThunk } from './store';
import { Item } from './types';

interface ItemsState {
  items: Item[];
}

const initialState: ItemsState = {
  items: [],
};

const itemsSlice = createSlice({
  name: 'items',
  initialState,
  reducers: {
    editItem(state, action: PayloadAction<{ 
    id: number; 
    Model:string;
    Color:string,
    YearOfManufacture:string;
    InsuranceVaildUpto:string;
    Kms:string;
    Location:string;
    NoOfOwners:string;
    Transmission:string;
    ExternalFitments:string;
    Photo:string;
     }>) {
      const { id,  Model ,Color,YearOfManufacture, InsuranceVaildUpto, Kms, Location, NoOfOwners, Transmission, ExternalFitments, Photo} = action.payload;
      const itemToEdit = state.items.find((item) => item.id === id);
      if (itemToEdit) {
        itemToEdit.Color = Color;
        itemToEdit.ExternalFitments = ExternalFitments;
        itemToEdit.InsuranceVaildUpto = InsuranceVaildUpto;
        itemToEdit.Kms = Kms;
        itemToEdit.Location = Location;
        itemToEdit.Model = Model;
        itemToEdit.NoOfOwners = NoOfOwners;
        itemToEdit.Photo = Photo;
        itemToEdit.Transmission = Transmission;
        itemToEdit.YearOfManufacture = YearOfManufacture;
      }
      
    },
   
    setItems(state, action: PayloadAction<Item[]>) {
      state.items = action.payload;
    },
  },
});

export const {  editItem, setItems } = itemsSlice.actions;

// Async thunk action to load items from AsyncStorage
export const loadItems = (): AppThunk => async (dispatch) => {
  try {
    const itemsJson = await AsyncStorage.getItem('items');
    if (itemsJson) {
      const items = JSON.parse(itemsJson);
      dispatch(setItems(items));
    }
  } catch (error) {
    console.error('Error loading items:', error);
  }
};

// Async thunk action to save items to AsyncStorage
export const saveItems = (): AppThunk => (dispatch, getState) => {
  const items = getState().items

  
  AsyncStorage.setItem('items', JSON.stringify(items));
};
